import React from 'react';
import { Link } from '@reach/router';
import Logo from '../images/CrimeLab_logo.png';
import { SHeader, SLogo } from '../styles/SHeader';

// 1. Learn how to create a styled basic styled component
// 2. Learn how to handle props in styled component
// 3. Create a global style with styled components

const Header = () => (
  <SHeader>
    <div className="header-content">
      <Link to="/">
        <SLogo src={Logo}
          alt="crime-lab-logo" />
      </Link>
    </div>
  </SHeader>
)

export default Header;
